import React from 'react';
import NavBar from './NavBar'; // Import NavBar component

const HomePage = () => {
  return (
    <div style={{
      width: '100vw',
      overflow: 'hidden' // hides any scrollbar that might appear
    }}>
      <NavBar /> {/* Include NavBar at the top of HomePage */}
      <img src="/home.png" alt="Home" style={{
        width: '100%',
        height: '63%',
        position: 'absolute',
        top: 0,
        left: '50%',
        transform: 'translateX(-50%)',
        zIndex: 1000 // Ensure image is below navbar
      }} />
      <div style={{ paddingTop: '60px', color: 'white' }}></div>
    </div>
  );
};

export default HomePage;
